import React, { Component } from 'react';
import classes from './GST_Registration.module.css';

class GstRegistration extends Component{

    render() {
        let menu = this.props.menu.map((item,index) => {
            let activeClass = '';
            if(this.props.selectedMenu === item){
                activeClass=classes.activeMark;
            }
            return(<div key={index} className={activeClass}>{item}</div>)
        })
        return (
            <div className={classes.ServiceDescription}>
                <h2> GST Registration </h2>
                <hr></hr>
                <div className={classes.ServiceDescriptionMenu}>
                    {menu}
                </div>
            </div>
        );
    }

}

export default GstRegistration;
